INSERT INTO `phpore_events` VALUES ('27', 'NPC1', 'NPC (1).png', '96', '96', '0,0,1', 'MESSAGE\r\n你好，需要帮助么？\r\nEND MESSAGE\r\n\r\nCHOICE $choix\r\n我迷路了...\r\n不，谢谢，我很好！\r\nEND CHOICE\r\n\r\nIF $choix = 0\r\nMESSAGE\r\n继续向北，你会发现我们的村庄，你可以去那休息一下。\r\nEND MESSAGE\r\nELSE\r\nMESSAGE\r\n好吧，那么祝你好运。\r\nEND MESSAGE\r\nEND IF', '', '1');
INSERT INTO `phpore_events` VALUES ('32', 'NPC2', 'NPC (2).png', '96', '96', '0,0,1', 'MESSAGE\r\n穷屌丝，你不能通过 ！在村子里发生了奇怪的事情。\r\nEND MESSAGE', 'YToyOntpOjA7YToyOntpOjA7aToxO2k6MTthOjE6e2k6MDtzOjcwOiLnqbflsYzkuJ3vvIzkvaDkuI3og73pgJrov4cg77yB5Zyo5p2R5a2Q6YeM5Y+R55Sf5LqG5aWH5oCq55qE5LqL5oOF44CCIjt9fWk6MTthOjI6e2k6MDtpOi0xO2k6MTthOjA6e319fQ==', '1');
INSERT INTO `phpore_events` VALUES ('33', 'NPC3', 'NPC (3).png', '96', '96', '0,0,1', 'MESSAGE\r\n为了解决这一问题，我们的战士封锁了村子。当这一切都结束的时候，你就可以回家。\r\nEND MESSAGE', 'YToyOntpOjA7YToyOntpOjA7aToxO2k6MTthOjE6e2k6MDtzOjExNDoi5Li65LqG6Kej5Yaz6L+Z5LiA6Zeu6aKY77yM5oiR5Lus55qE5oiY5aOr5bCB6ZSB5LqG5p2R5a2Q44CC5b2T6L+Z5LiA5YiH6YO957uT5p2f55qE5pe25YCZ77yM5L2g5bCx5Y+v5Lul5Zue5a6244CCIjt9fWk6MTthOjI6e2k6MDtpOi0xO2k6MTthOjA6e319fQ==', '1');
