INSERT INTO `phpore_events` VALUES ('36', '金库存储例子', 'NPC (6).png', '96', '96', '0,0,1', 'PHP\r\n$this->vars[\'points\'] = $user->points;\r\nEND PHP\r\n\r\nIF $USER_loan = 0 \r\n\r\n	MESSAGE HTML \r\n	<b>金库守护者</b><br> \r\n       你好，欢迎来到存储库。 \r\n	G : <i>$points</i>\r\n	END MESSAGE \r\n	\r\n	MESSAGE HTML \r\n	<b>金库守护者</b><br> \r\n	你想做什么？ \r\n	END MESSAGE\r\n	\r\n	CHOICE $action  \r\n	存 \r\n	取 \r\n	贷\r\n	Exit\r\n	END CHOICE \r\n\r\n	IF $action = 0 \r\n\r\n		INPUT_NUMBER $value MESSAGE HTML \r\n		<b>金库守护者</b><br> \r\n		你想存多少？ \r\n		END MESSAGE \r\n\r\n		IF $value <= $points \r\n\r\n			VAR $USER_vault + $value \r\n			VAR $points - $value\r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			你存了 $value! \r\n			END MESSAGE \r\n\r\n		ELSE \r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			你没有这么多钱! \r\n			END MESSAGE \r\n\r\n		END IF \r\n\r\n	END IF \r\n\r\n	IF $action = 1 \r\n\r\n		INPUT_NUMBER $value MESSAGE HTML\r\n		<b>金库守护者</b><br> \r\n		你想取多少？ \r\n		END MESSAGE \r\n\r\n		IF $USER_vault >= $value \r\n\r\n			VAR $USER_vault - $value \r\n			VAR $points + $value\r\n\r\n			// 在这用代码更新钱 ！ \r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			你取了 $value! \r\n			END MESSAGE \r\n\r\n		ELSE \r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			你并没有存那么多钱！ \r\n			END MESSAGE \r\n\r\n		END IF \r\n\r\n	END IF \r\n\r\n	IF $action = 2 \r\n\r\n		INPUT_NUMBER $value MESSAGE HTML \r\n		<b>金库守护者</b><br> \r\n		你想借多少？ \r\n		END MESSAGE \r\n\r\n		IF $value <= 1000 \r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			这里是你的钱。 \r\n			记得还，不然，嘿嘿...... \r\n			END MESSAGE \r\n\r\n			VAR $USER_loan = $value \r\n			VAR $points + $value\r\n\r\n			// 在这用代码更新钱 ！ \r\n\r\n		ELSE \r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			你太屌丝了，不能借那么多钱 ！<br> \r\n			最多借你1000 G \r\n			END MESSAGE \r\n\r\n		END IF \r\n\r\n	END IF \r\n\r\nELSE\r\n\r\n	MESSAGE HTML \r\n	<b>金库守护者</b><br> \r\n	在你还贷前， <br> \r\n	你只能存和取款！ \r\n	END MESSAGE \r\n\r\n	// 在这用代码更新$points钱 ！ \r\n\r\n	IF $points >= $USER_loan \r\n\r\n		MESSAGE HTML \r\n		<b>金库守护者</b><br> \r\n		来还款么？ \r\n		END MESSAGE \r\n\r\n		CHOICE $loan \r\n		Yes \r\n		No, 没钱 \r\n		END CHOICE \r\n\r\n		IF $loan = 0 \r\n\r\n		\r\n		    VAR $points - $USER_loan\r\n			VAR $USER_loan = 0 \r\n			// 在这用代码更新$points钱 \r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			谢谢，随时欢迎再次使用金库 ！ \r\n			END MESSAGE \r\n\r\n		ELSE \r\n\r\n			MESSAGE HTML \r\n			<b>金库守护者</b><br> \r\n			请稍后再来 ！ \r\n			END MESSAGE \r\n\r\n		END IF \r\n\r\n	END IF \r\n\r\nEND IF\r\n\r\nPHP\r\nif ( $this->vars[\'points\'] != $user->points )\r\n{\r\n	$user->set(\'points\', $this->vars[\'points\']);\r\n}\r\nEND PHP', '', '1');
